  margin-left: 5vw;
  margin-top: 150px;
  background-color: #f8f8ff;
  padding: 50px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding-top: 30px;
  .articels {
    width: 40%;
    background-color: lawngreen;
    display: flex;
    flex-direction: column;
  }
`;

